webpackJsonp([2037],{"./node_modules/json-loader/index.js!./.cache/json/articles-certificates-wherefore-art-thou.json":function(e,o){e.exports={data:{markdownRemark:{html:'<p><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/triangular_flag_on_post.png?v=3" alt=":triangular_flag_on_post:" title=":triangular_flag_on_post:"> Remember to use <a><strong><code>Read-Search-Ask</code></strong></a> if you get stuck. Try to pair program <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/busts_in_silhouette.png?v=3" alt=":busts_in_silhouette:" title=":busts_in_silhouette:"> and write your own code <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/pencil.png?v=3" alt=":pencil:" title=":pencil:"></p>\n<h3><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/checkered_flag.png?v=3" alt=":checkered_flag:" title=":checkered_flag:"> Problem Explanation:</h3>\n<p>Write an algorithm that will take an <code>array</code> for the first argument and return an <code>array</code> with all the <code>object</code>s that matches all the properties and values in the <code>Object</code> passed as second parameter.</p>\n<h4>Relevant Links</h4>\n<ul>\n<li><a>For Loops</a></li>\n<li><a>Array.prototype.filter()</a></li>\n<li><a href="https://developer.mozilla.org/en/docs/Web/JavaScript/Reference/Global_Objects/Object/hasOwnProperty">Object.hasOwnProperty()</a></li>\n</ul>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/speech_balloon.png?v=3" alt=":speech_balloon:" title=":speech_balloon:"> Hint: 1</h2>\n<p>You may use <code>for</code> loop or the <code>Array.prototype.filter</code> method.</p>\n<blockquote>\n<p><em>try to solve the problem now</em></p>\n</blockquote>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/speech_balloon.png?v=3" alt=":speech_balloon:" title=":speech_balloon:"> Hint: 2</h2>\n<p>Try to use the <code>Object.prototype.hasOwnProperty</code> method to know if the property name exists in an object (as its own property).</p>\n<blockquote>\n<p><em>try to solve the problem now</em></p>\n</blockquote>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/speech_balloon.png?v=3" alt=":speech_balloon:" title=":speech_balloon:"> Hint: 3</h2>\n<p>Check equivalence of <code>Object</code> in <code>collection</code> with <code>Object</code> passed as second parameter to <code>whatIsInAName</code> function.</p>\n<blockquote>\n<p><em>try to solve the problem now</em></p>\n</blockquote>\n<h2>Spoiler Alert!</h2>\n<p><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/2/2d6c412a50797771301e7ceabd554cef4edcd74d.gif" alt="687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif"></p>\n<p><strong>Solution ahead!</strong></p>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/beginner.png?v=3" alt=":beginner:" title=":beginner:"> Basic Code Solution:</h2>\n<pre><code>function whatIsInAName(collection, source) {\n  // "What\'s in a name? that which we call a rose\n  // By any other name would smell as sweet.”\n  // -- by William Shakespeare, Romeo and Juliet\n  var srcKeys = Object.keys(source);\n\n  // filter the collection\n  return collection.filter(function (obj) {\n    for(var i = 0; i &#x3C; srcKeys.length; i++) {\n      if(!obj.hasOwnProperty(srcKeys[i]) || obj[srcKeys[i]] !== source[srcKeys[i]]) {\n        return false;\n      }\n    }\n    return true;\n  });\n}\n\n// test here\nwhatIsInAName([{ first: "Romeo", last: "Montague" }, { first: "Mercutio", last: null }, { first: "Tybalt", last: "Capulet" }], { last: "Capulet" });\n</code></pre>\n<p><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=3" alt=":rocket:" title=":rocket:"> <a href="https://repl.it/CLmh/0">Run Code</a></p>\n<h3>Code Explanation:</h3>\n<ul>\n<li>We filter through the array using <code>.filter()</code>.</li>\n<li>Using a <code>for loop</code> we loop through each item in the object.</li>\n<li>We use a <code>if statement</code> to check if the object in the collection doesn\'t have the key and the property value doesn\'t match the value in source.</li>\n<li>We return <code>false</code> if the above <code>if statement</code> is correct. Otherwise, we return <code>true</code>;</li>\n</ul>\n<h4>Relevant Links</h4>\n<ul>\n<li><a>For Loops</a></li>\n<li><a>Array.prototype.filter()</a></li>\n<li><a href="https://developer.mozilla.org/en/docs/Web/JavaScript/Reference/Global_Objects/Object/hasOwnProperty">Object.hasOwnProperty()</a></li>\n</ul>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/sunflower.png?v=3" alt=":sunflower:" title=":sunflower:"> Intermediate Code Solution:</h2>\n<pre><code>function whatIsInAName(collection, source) {\n  // "What\'s in a name? that which we call a rose\n  // By any other name would smell as sweet.”\n  // -- by William Shakespeare, Romeo and Juliet\n  var srcKeys = Object.keys(source);\n\n  return collection.filter(function (obj) {\n    return srcKeys.every(function (key) {\n      return obj.hasOwnProperty(key) &#x26;&#x26; obj[key] === source[key];\n    });\n  });\n}\n\n// test here\nwhatIsInAName([{ first: "Romeo", last: "Montague" }, { first: "Mercutio", last: null }, { first: "Tybalt", last: "Capulet" }], { last: "Capulet" });\n</code></pre>\n<p><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=3" alt=":rocket:" title=":rocket:"> <a href="https://repl.it/CLmi/0">Run Code</a></p>\n<h3>Code Explanation:</h3>\n<ul>\n<li>We filter through the collection using <code>.filter()</code>.</li>\n<li>Next, we return a <code>Boolean</code> value for the <code>.filter()</code> method.</li>\n<li>Finally, we reduce to <code>Boolean</code> value to be returned for the <code>.every()</code> method.</li>\n</ul>\n<h4>Relevant Links</h4>\n<ul>\n<li><a>Array.prototype.filter()</a></li>\n<li><a>Array.prototype.every()</a></li>\n<li><a href="https://developer.mozilla.org/en/docs/Web/JavaScript/Reference/Global_Objects/Object/hasOwnProperty">Object.hasOwnProperty()</a></li>\n</ul>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/rotating_light.png?v=3" alt=":rotating_light:" title=":rotating_light:"> Advanced Code Solution:</h2>\n<pre><code>function whatIsInAName(collection, source) {\n  // "What\'s in a name? that which we call a rose\n  // By any other name would smell as sweet.”\n  // -- by William Shakespeare, Romeo and Juliet\n  var srcKeys = Object.keys(source);\n\n  // filter the collection\n  return collection.filter(function (obj) {\n    return srcKeys\n      .map(function(key) {\n        return obj.hasOwnProperty(key) &#x26;&#x26; obj[key] === source[key];\n      })\n      .reduce(function(a, b) {\n        return a &#x26;&#x26; b;\n      });\n  });\n}\n\n// test here\nwhatIsInAName([{ first: "Romeo", last: "Montague" }, { first: "Mercutio", last: null }, { first: "Tybalt", last: "Capulet" }], { last: "Capulet" });\n</code></pre>\n<p><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=3" alt=":rocket:" title=":rocket:"> <a href="https://repl.it/CLmj/0">Run Code</a></p>\n<h3>Code Explanation:</h3>\n<ul>\n<li>We start by filtering through <code>collection</code> using <code>Array.filter()</code>.</li>\n<li>Next, we map through all keys and return Boolean values based on the check conditions: both the key and its corresponding value must exist within the object we are filtering through.</li>\n<li>Then we reduce the mapped Boolean values to a single Boolean that indicates whether all srcKeys pass the conditions checked above.</li>\n<li>This single Boolean will be used to filter through the collection.</li>\n</ul>\n<h4>Relevant Links</h4>\n<ul>\n<li><a>Array.prototype.filter()</a></li>\n<li><a>Array.prototype.reduce()</a></li>\n<li><a href="https://developer.mozilla.org/en/docs/Web/JavaScript/Reference/Global_Objects/Object/hasOwnProperty">Object.hasOwnProperty()</a></li>\n</ul>\n<h2><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/clipboard.png?v=3" alt=":clipboard:" title=":clipboard:"> NOTES FOR CONTRIBUTIONS:</h2>\n<ul>\n<li><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/warning.png?v=3" alt=":warning:" title=":warning:"> <strong>DO NOT</strong> add solutions that are similar to any existing solutions. If you think it is <strong><em>similar but better</em></strong>, then try to merge (or replace) the existing similar solution.</li>\n<li>Add an explanation of your solution.</li>\n<li>Categorize the solution in one of the following categories — <strong>Basic</strong>, <strong>Intermediate</strong> and <strong>Advanced</strong>. <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/traffic_light.png?v=3" alt=":traffic_light:" title=":traffic_light:"></li>\n<li>Please add your username only if you have added any <strong>relevant main contents</strong>. (<img src="https://forum.freecodecamp.com/images/emoji/emoji_one/warning.png?v=3" alt=":warning:" title=":warning:"> <strong><em>DO NOT</em></strong> <em>remove any existing usernames</em>)</li>\n</ul>\n<blockquote>\n<p>See <img src="https://forum.freecodecamp.com/images/emoji/emoji_one/point_right.png?v=3" alt=":point_right:" title=":point_right:"> <a href="http://forum.freecodecamp.com/t/algorithm-article-template/14272"><strong><code>Wiki Challenge Solution Template</code></strong></a> for reference.</p>\n</blockquote>',frontmatter:{title:"Wherefore Art Thou",parent:"/home/stuart/guides/src/pages/articles/certificates/wherefore-art-thou/index.md absPath of file"}}},pathContext:{slug:"/articles/certificates/wherefore-art-thou/"}}}});
